import ExpenseItem from './components/ExpenseItem';

function App() {

  var expenses = [
    {
      id: 1,
      title: 'Dress',
      amount: 2000,
      date: new Date(2021, 8, 22)
    },
    {
      id: 2,
      title: 'Snacks',
      amount: 200,
      date: new Date(2021, 8, 20)
    },
    {
      id: 3,
      title: 'travel',
      amount: 1500,
      date: new Date(2021, 8, 12)
    },

  ]

  for (let x of expenses) {
    return (
      <div>
        <p>{x}</p>
        <ExpenseItem date={x.date} title={x.title} amount={x.date}></ExpenseItem>

      </div>
    );
  }

}

export default App;
